import React from 'react'

const ObjectiveOfWebsite = () => {
    return (
        <div>
            Objective: Malicious hackers do far more damage than the traditional forms of attacks. A single bullet may kill a person, but a single security vulnerability could destroy business, lives, and nations. The purpose of the proposed Security Ops Club is to educate members about the history of these vulnerabilities and their applications, the government use of these vulnerabilities, how to perform such attacks in a safe manner, and how to secure a system against them. 

Topics discussed within this document: Fields of study, risks of the club and our solutions, staff/leadership descriptions, funding, comparison to other “similar” clubs. 
        </div>
    )
}

export default ObjectiveOfWebsite
